// import { IonRouterOutlet } from "@ionic/react-router";
import { IonRouterOutlet} from '@ionic/react';
import { Redirect, Route } from "react-router-dom";
import NuevoGasto from './NuevoGasto';
import Gastos from './NuevoGasto';


const RoutesGastos: React.FC = () => {

    return <>
        <Route path='/page/Gastos' exact={true} ><Redirect to="/page/Gastos/nuevo" /></Route>
        <Route path='/page/Gastos/nuevo' exact={true} component={NuevoGasto} />
    </>
}

export default RoutesGastos;
